import React, { Component } from "react";
import { Link } from "react-router-dom";

import axios from "axios";
import Avatar from "../assets/img/default-user-avatar.png";

import swal from "sweetalert";
import $ from "jquery";

export default class Header extends Component {
  // constructor(props) {
  //   super(props);
  //   this.state = {
  //     token: localStorage["appState"]
  //       ? JSON.parse(localStorage["appState"]).user.token
  //       : "",
  //     user: [],
  //   };
  // }
  // componentDidMount() {
  //   axios
  //     .get(
  //       `${axios.defaults.baseURL}/user/${
  //         JSON.parse(localStorage["appState"]).user.id
  //       }`,
  //       {
  //         headers: {
  //           Authorization: `Bearer ${this.state.token}`,
  //         },
  //       }
  //     )
  //     .then((response) => {
  //       //console.log(response);
  //       return response;
  //     })
  //     .then((json) => {
  //       if (json.data.success) {
  //         this.setState({ user: json.data.user[0] });
  //         // } else alert("Cannot Fetch Data!");
  //       } else swal("Oops!", "Cannot Fetch Data!", "error");
  //     })
  //     .catch((error) => {
  //       console.error(`An Error Occured! ${error}`);
  //     });
  //   // alert(id)
  // }
  // logoutUser = () => {
  //   localStorage.clear();
  //   window.location.href = "/login";
  // };

  render() {

    return (
      <>
        <meta name="ac-gn-store-key" content="SFX9YPYY9PPXCU9KH" />
        <input
          type="checkbox"
          id="ac-gn-menustate"
          className="ac-gn-menustate"
        />
        <nav
          id="ac-globalnav"
          className="no-js"
          role="navigation"
          aria-label="Global"
          data-hires="false"
          data-analytics-region="global nav"
          lang="en-NG"
          dir="ltr"
          data-search-locale="en_NG"
          data-search-suggestions-api="/search-services/suggestions/"
          data-search-defaultlinks-api="/search-services/suggestions/defaultlinks/"
        >
          <div className="ac-gn-content">
            <ul className="ac-gn-header">
              <li className="ac-gn-item ac-gn-menuicon">
                <label
                  className="ac-gn-menuicon-label"
                  for="ac-gn-menustate"
                  aria-hidden="true"
                >
                  <span className="ac-gn-menuicon-bread ac-gn-menuicon-bread-top">
                    <span className="ac-gn-menuicon-bread-crust ac-gn-menuicon-bread-crust-top"></span>
                  </span>
                  <span className="ac-gn-menuicon-bread ac-gn-menuicon-bread-bottom">
                    <span className="ac-gn-menuicon-bread-crust ac-gn-menuicon-bread-crust-bottom"></span>
                  </span>
                </label>
                <a
                  href="#ac-gn-menustate"
                  role="button"
                  className="ac-gn-menuanchor ac-gn-menuanchor-open"
                  id="ac-gn-menuanchor-open"
                >
                  <span className="ac-gn-menuanchor-label">
                    Global Nav Open Menu
                  </span>
                </a>
                <a
                  href="#"
                  role="button"
                  className="ac-gn-menuanchor ac-gn-menuanchor-close"
                  id="ac-gn-menuanchor-close"
                >
                  <span className="ac-gn-menuanchor-label">
                    Global Nav Close Menu
                  </span>
                </a>
              </li>
              <li className="ac-gn-item ac-gn-apple">
                <a
                  className="ac-gn-link ac-gn-link-apple"
                  href="/"
                  data-analytics-title="apple home"
                  id="ac-gn-firstfocus-small"
                >
                  <span className="ac-gn-link-text">SapioClub</span>
                </a>
              </li>
            </ul>
            <ul className="ac-gn-list">
              <li className="ac-gn-item ac-gn-apple">
                <Link
                  className="ac-gn-link ac-gn-link-apple"
                  to="/"
                  data-analytics-title="Home"
                  id="ac-gn-firstfocus"
                >
                  {/* <span>Home</span> */}
                </Link>
              </li>
              <li className="ac-gn-item ac-gn-item-menu">
                <Link
                  className="ac-gn-link"
                  to="/about"
                  data-analytics-title="About the Club"
                >
                  <span>About the Club</span>
                </Link>
              </li>
              <li className="ac-gn-item ac-gn-item-menu">
                <Link
                  className="ac-gn-link"
                  to="/membership"
                  data-analytics-title="Membership"
                >
                  <span>Membership</span>
                </Link>
              </li>
              <li className="ac-gn-item ac-gn-item-menu">
                <Link
                  className="ac-gn-link"
                  to="/events"
                  data-analytics-title="Events"
                >
                  <span>Events</span>
                </Link>
              </li>
              <li className="ac-gn-item ac-gn-item-menu">
                <Link
                  className="ac-gn-link"
                  to="/services"
                  data-analytics-title="Services"
                >
                  <span>Services</span>
                </Link>
              </li>
              <li className="ac-gn-item ac-gn-item-menu">
                <Link
                  className="ac-gn-link"
                  to="/contact"
                  data-analytics-title="support"
                >
                  <span>Contact Us</span>
                </Link>
              </li>
            </ul>
          </div>
        </nav>
        <div className="ac-gn-blur"></div>
        <div id="ac-gn-curtain" className="ac-gn-curtain"></div>
        <div id="ac-gn-placeholder" className="ac-nav-placeholder"></div>

        {/* <script type="text/javascript" src="https://www.apple.com/ac/globalnav/6/en_NG/scripts/ac-globalnav.built.js"></script> */}

        {/* <script src="https://www.apple.com/metrics/ac-analytics/2.11.0/scripts/ac-analytics.js" type="text/javascript" charset="utf-8"></script> */}

        <input
          type="checkbox"
          id="ac-ln-menustate"
          className="ac-ln-menustate"
        />
        <nav
          id="ac-localnav"
          className="no-js without-violator ac-localnav-dark"
          lang="en-NG"
          dir="ltr"
          data-sticky
          data-analytics-region="local nav"
          role="navigation"
          aria-label="Local"
        >
          <div className="ac-ln-wrapper">
            <div className="ac-ln-background"></div>
            <div className="ac-ln-content">
              <div className="ac-ln-title">
                <Link to="/" data-analytics-title="product index">
                  The SapioClub
                </Link>
              </div>
              <div className="ac-ln-menu">
                <a
                  href="#ac-ln-menustate"
                  className="ac-ln-menucta-anchor ac-ln-menucta-anchor-open"
                  id="ac-ln-menustate-open"
                >
                  <span className="ac-ln-menucta-anchor-label">
                    Local Nav Open Menu
                  </span>
                </a>
                <a
                  href="#"
                  className="ac-ln-menucta-anchor ac-ln-menucta-anchor-close"
                  id="ac-ln-menustate-close"
                >
                  <span className="ac-ln-menucta-anchor-label">
                    Local Nav Close Menu
                  </span>
                </a>
                <div className="ac-ln-menu-tray">
                  <ul className="ac-ln-menu-items">
                    <li className="ac-ln-menu-item">
                      <span
                        className="ac-ln-menu-link current"
                        role="link"
                        aria-disabled="true"
                        aria-current="page"
                        data-analytics-title="member"
                      >
                        Already a Member?
                      </span>
                    </li>
                    <li className="ac-ln-menu-item">
                      <Link
                        to="/login"
                        className="ac-ln-menu-link"
                        data-analytics-title="specs"
                      >
                        Login
                      </Link>
                    </li>
                  </ul>
                </div>
                <div className="ac-ln-actions">
                  <div
                    className="ac-ln-action ac-ln-action-menucta"
                    aria-hidden="true"
                  >
                    <label for="ac-ln-menustate" className="ac-ln-menucta">
                      <span className="ac-ln-menucta-chevron"></span>
                    </label>
                  </div>
                  <div className="ac-ln-action ac-ln-action-button">
                    <Link
                      className="ac-ln-button"
                      to="/register"
                      data-analytics-title="buy The SapioClub"
                    >
                      Join Now<span className="ac-ln-action-product"></span>
                    </Link>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </nav>
      </>
    );
  }
}
